import Calendar from '../../components/BookMeeting';
const MyCalendar = (props)=>{

    return(
        <>
            <div className="body">
                <h1>Calendrier des r√©unions</h1>
                <Calendar profile={props.data.profile} loc="profile"/>
            </div>
        </>
    )
}
export const getServerSideProps = async (ctx) => {
    try {
        const cookie = ctx.req.headers.cookie ;
        const url = "http://localhost:9000/profiles/myprofile" ;
        const res = await fetch( url,{headers : {cookie}}); 
        const statusCode = res.status;
        const data = await res.json();
        
        if (statusCode !== 200) {
            throw statusCode 
        }
        return  {
            props : {data }
        }
    } 
    catch (error) {
        ctx.res.statusCode = error;
        return {
               props : {statusCode : error}
        };
    }   
}
export default MyCalendar ;
